import React from 'react';
import { motion } from 'framer-motion';

const FeatureCard = ({ icon, title, description }) => (
  <motion.div
    whileHover={{ scale: 1.05 }}
    className="bg-gray-900 rounded-lg p-6 shadow-lg border border-gray-800"
  >
    <div className="text-blue-500 mb-4">{icon}</div>
    <h3 className="text-xl font-bold mb-2 text-white">{title}</h3>
    <p className="text-gray-400">{description}</p>
  </motion.div>
);

function Info1() {
  return (
    <div className="min-h-screen bg-gradient-to-br from-gray-900 to-black text-white py-20 px-4">
      <div className="max-w-6xl mx-auto">
        <motion.div
          initial={{ opacity: 0, y: 20 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.8 }}
          className="text-center mb-20"
        >
          <h1 className="text-5xl font-extrabold mb-6 leading-tight">
            Build business software <br /> you actually want
          </h1>
          <p className="text-2xl text-blue-400 mb-8">
            AI-powered no code apps
          </p>
          <p className="text-xl text-gray-400 max-w-3xl mx-auto mb-12">
            Glide makes it easy to build and deploy custom tools your business needs and team will love — with clicks, not code.
          </p>
          <motion.button
            whileHover={{ scale: 1.05 }}
            whileTap={{ scale: 0.95 }}
            className="px-8 py-4 bg-blue-600 text-white text-lg font-semibold rounded-full hover:bg-blue-700 transition duration-300"
          >
            Start for free
          </motion.button>
        </motion.div>

        <div className="grid grid-cols-1 md:grid-cols-3 gap-8 mb-20">
          <FeatureCard
            icon={<svg className="w-12 h-12" fill="none" stroke="currentColor" viewBox="0 0 24 24" xmlns="http://www.w3.org/2000/svg"><path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M4 7v10c0 2.21 3.582 4 8 4s8-1.79 8-4V7M4 7c0 2.21 3.582 4 8 4s8-1.79 8-4M4 7c0-2.21 3.582-4 8-4s8 1.79 8 4m0 5c0 2.21-3.582 4-8 4s-8-1.79-8-4" /></svg>}
            title="Data sources that sync and scale"
            description="Connect to your existing data or start from scratch with spreadsheet-like tables."
          />
          <FeatureCard
            icon={<svg className="w-12 h-12" fill="none" stroke="currentColor" viewBox="0 0 24 24" xmlns="http://www.w3.org/2000/svg"><path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M4 5a1 1 0 011-1h14a1 1 0 011 1v2a1 1 0 01-1 1H5a1 1 0 01-1-1V5zM4 13a1 1 0 011-1h6a1 1 0 011 1v6a1 1 0 01-1 1H5a1 1 0 01-1-1v-6zM16 13a1 1 0 011-1h2a1 1 0 011 1v6a1 1 0 01-1 1h-2a1 1 0 01-1-1v-6z" /></svg>}
            title="Drag-and-drop components"
            description="Build your interface with pre-built components for tables, charts, forms, and more."
          />
          <FeatureCard
            icon={<svg className="w-12 h-12" fill="none" stroke="currentColor" viewBox="0 0 24 24" xmlns="http://www.w3.org/2000/svg"><path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M19 21V5a2 2 0 00-2-2H7a2 2 0 00-2 2v16m14 0h2m-2 0h-5m-9 0H3m2 0h5M9 7h1m-1 4h1m4-4h1m-1 4h1m-5 10v-5a1 1 0 011-1h2a1 1 0 011 1v5m-4 0h4" /></svg>}
            title="Build custom workflows"
            description="Create powerful automations and integrations to streamline your processes."
          />
        </div>

        <div className="grid grid-cols-1 md:grid-cols-3 gap-8">
          {['Data sources that sync and scale', 'Drag-and-drop components', 'Build custom workflows'].map((title, index) => (
            <div key={index} className="bg-gray-800 rounded-lg overflow-hidden">
              <div className="h-48 bg-gray-700 flex items-center justify-center">
                <span className="text-gray-500 text-lg">Image Placeholder</span>
              </div>
              <div className="p-4">
                <p className="text-sm text-gray-400">{title}</p>
              </div>
            </div>
          ))}
        </div>
      </div>
    </div>
  );
}

export default Info1;
